args):\n    # Get the ISO3 country code for the given country name\n    iso3_code = get_country_code(country_name=country_name)\n    \n    # Define the parameters for getting the population data\n    params = {\n        ''location_code'': iso3_code,\n        ''output_format'': ''json'',\n        ''limit'': 1000\n    }\n    \n    # Fetch population data for the given country code\n    population_data = get_hdx_population(**params)\n\n    # Calculate the total population\n    total_pop = 0\n    if population_data:  # Check if there is data in the response\n        for record in population_data:\n            total_pop += record.get(\"population\", 0)\n    \n    # print the total population and return it\n    print(f\"Total population of {country_name} is: {total_pop}\")\n    return {''total_population'': total_pop}\n\n\n", "calling_code_example": "    country = ''Mali''\n    total_population = get_total_population(country_name=country)\n    total_population_json = json.dumps(total_population)\n    # Print debug information\n    print(\"DEBUG INFO - Total population data:\", total_population_json)\n\n", "calling_code_run_status": "OK", "data_sources": ["HDX"], "created": "2024-02-01 00:32:36", "response_format": "string", "mem_type": "recipe", "source": "Recipes Assistant", "function_response_fields": [{"name": "total_population", "type": "integer"}], "custom_id": "3003c3c7-4c6b-4743-b542-2095fd8597eb"}','3003c3c7-4c6b-4743-b542-2095fd8597eb','06895671-8915-4f87-bb03-1a159eabbf21'),
