a = world.merge(data, on=''country'')\n\n    # Plotting the map\n    fig, ax = plt.subplots(1, 1, figsize=(15, 10))\n    world_risk_data.plot(column=''overall_risk'', ax=ax, legend=True,\n                         missing_kwds={''color'': ''lightgrey''},\n                         legend_kwds={''label'': ''Overall Risk by Country'', ''orientation'': ''horizontal''})\n    ax.set_title(''World Map of Overall Risk by Country'')\n\n    # Add light gray outlines for all countries, even if they have no risk data\n    world.boundary.plot(color=''lightgray'', linewidth=1, ax=ax)\n\n    # Remove axes for better clarity\n    ax.set_axis_off()\n\n    # Show the plot\n    plt.show()", "calling_code": "import pandas as pd\n\n# Load the data\ndata = pd.read_csv(''risk_data.csv'')\n\n# Call the function\nplot_world_map(data)", "calling_code_run_status": "OK", "calling_code_run_time": "", "mem_type": "memory", "source": "Chat", "custom_id": "fc90fb06-eb2b-4fde-bc9c-476f5d97b191"}','fc90fb06-eb2b-4fde-bc9c-476f5d97b191','2514442c-0cd4-4e67-afe5-2cbd4645e750'),
