oundaries geojson for"}, "data": {"type": "string", "description": "The data to be plotted on a map, as a list of dictionaries. Each record should look like this ...\n                            [\n                                {\n                                    \"pcode\": \"ML0102\",\n                                    \"metric\": 10000\n                                },\n                                {\n                                    \"pcode\": \"ML0103\",\n                                    \"metric\": 20000\n                                }\n                            ]\n\n                            IMPORTANT: each item in the list MUST have fields ''pcode'' and ''metric''\n                            "}, "admin_level": {"type": "string", "description": "The administration level to get boundaries for, ranging from 1-2"}}}, "functions_code": "def plot_data_on_map(title, data, country, admin_level):\n\n    admin_level = admin_level.replace(\"admin\",\"\")\n\n    # convert list of json records to dataframe\n    data = json.loads(data)\n    data = pd.DataFrame.from_records(data)\n    print(data.head())\n\n    # Read shapefile\n    shape_file_location = get_shapefile(country,admin_level)\n    shape_file_location = shape_file_location[''file_location'']\n    print(shape_file_location)\n\n    # Read shapefile\n    gdf = gpd.read_file(shape_file_location)\n    print(gdf.head())\n    #gdf.to_excel(''mali_adm1.xlsx'')\n\n    print(f''ADM{admin_level}_PCODE'')\n    print(len(gdf[f''ADM{admin_level}_PCODE'']))\n\n    # Merge shapefile and population data\n    merged = gdf.merge(data, left_on=f''ADM{admin_level}_PCODE'', right_on=''pcode'')\n    print(merged.head())\n\n    # Plot population data\n    fig, ax = plt.subplots(1, figsize=(10, 6))\n    ax.axis(''off'')\n    ax.set_title(title, fontdict={''fontsize'': ''25'', ''fontweight'' : ''3''})\n    merged.plot(column=''metric'', cmap=''Blues'', linewidth=0.8, ax=ax, edgecolor=''0.8'', legend=True)\n    #p