s as gpd\n    import zipfile\n    import os\n    import pandas as pd\n    import matplotlib.pyplot as plt\n\n    # Unzipping the admin level 1 boundaries\n    with zipfile.ZipFile(zip_file_location, ''r'') as zip_ref:\n        zip_ref.extractall(unzip_folder)\n\n    # Load Mali''s shapefile\n    mli_adm1_gdf = gpd.read_file(f''{unzip_folder}/{shape_file}'')\n\n    # Read and filter the population data for Mali\n    population_df = pd.read_csv(population_data_file)\n    mali_population_df = population_df[population_df[''adm0_code''] == ''MLI'']\n\n    # Group the population by admin1_code to get the total population per admin1\n    mali_population_by_admin1 = mali_population_df.groupby(''adm1_code'')[''population''].sum().reset_index()\n\n    # Merge the population data with the geopandas dataframe using admin1_code\n    mli_adm1_gdf_merged = mli_adm1_gdf.merge(mali_population_by_admin1, left_on=''adm1_code'', right_on=''adm1_code'')\n\n    # Plotting the map\n    fig, ax = plt.subplots(1, 1, figsize=(10, 10))\n    mli_adm1_gdf_merged.plot(column=''population'', ax=ax, legend=True, \n                             legend_kwds={''label'': ''Population by Admin1'', \n                                          ''orientation'': ''horizontal''})\n    ax.set_title(''Population by Admin1 in Mali'')\n\n    # Remove axes for clarity\n    ax.set_axis_off()\n\n    plt.show()\n", "calling_code": "generate_population_map(''/mnt/data/<FILE ID FOR: d__hdx_population.csv>'', ''/mnt/data/<FILE ID FOR: d__geoBoundaries-adm1-countries_a-z.zip>'', ''/mnt/data/geoBoundaries_MLI_adm1'', ''mli_admbnda_adm1.shp'')", "calling_code_run_status": "OK", "calling_code_run_time": "", "mem_type": "memory", "source": "Chat", "custom_id": "4e96b3e9-b9b6-4a17-9355-a92be6a6d3a0"}','4e96b3e9-b9b6-4a17-9355-a92be6a6d3a0','b8086e4b-e4e2-4f0a-bf98-b26adc36b6dc'),
