ity_data_file)\n\n    # Filter the data for Chad\n    chad_food_security_df = food_security_df[food_security_df[''adm0_code''] == ''TCD'']\n\n    # Unzipping the admin level 2 boundaries for Chad\n    with zipfile.ZipFile(shapefile_zip_file, ''r'') as zip_ref:\n        zip_ref.extractall(shapefile_extract_folder)\n\n    # Find Chad shapefile for admin level 2 in the unzipped folder\n    chad_shapefile = ''tcd_admbnda_adm2.shp''\n\n    # Load Chad''s shapefile using GeoPandas\n    chad_gdf = gpd.read_file(f''{shapefile_extract_folder}/{chad_shapefile}'')\n\n    # Group the food security data by adm2_code\n    chad_food_security_by_adm2 = chad_food_security_df.groupby(''adm2_code'').agg({\n        ''population_in_phase'': ''sum'',\n        ''population_fraction_in_phase'': ''mean''  # We use mean to get an average fraction\n    }).reset_index()\n\n    # Merge the food security data with the geopandas dataframe using adm2_code\n    chad_gdf_merged = chad_gdf.merge(chad_food_security_by_adm2, on=''adm2_code'')\n\n    # Plotting the map\n    fig, ax = plt.subplots(1, 1, figsize=(12, 12))\n    chad_gdf_merged.plot(column=''population_fraction_in_phase'', ax=ax, legend=True,\n                         legend_kwds={''label'': ''Population Fraction in IPC Phase'',\n                                      ''orientation'': ''horizontal''})\n    ax.set_title(''Food Security IPC Phases Fraction in Chad by Admin2'')\n\n    # Remove axes for clarity\n    ax.set_axis_off()\n\n    plt.show()", "intent": "Generate an administrative level 2 map of food security in Chad ", "mem_type": "memory", "response_text": "", "function_response_fields": "[]", "calling_code": "generate_food_security_map(''/mnt/data/<FILE ID FOR: a__hdx_food_security.csv>'', ''/mnt/data/<FILE ID FOR: a__geoBoundaries-adm2-countries_i-z.zip>'', ''/mnt/data/shp_chad_adm2'')", "data_sources": "[''a__hdx_food_security.csv'', ''a__geoBoundaries-adm2-countries_i-z.zip'']", "response_image": "data:image/png;base64,", "custom